import React, { useState, Fragment } from "react";


export const Word = (props) => {
    const { color, x, y, size, index, click } = props;
    console.log("click --->,", click)
    const wordStyle = {
        backgroundColor: color,
        height: `${size}px`,
        width: `${size}px`,
        left: `${props.x}px`,
        top: `${props.y}px`,
    };
    return (
        <Fragment>
            <div
                style={wordStyle}
                onClick={() => click(index)}
            >{props.text}</div>
            <div onClick={() => click(index)}>Hello</div>
        </Fragment>
    );
};


export default Word;
